Legion of Super-Heroes v3 #27
Publisher:  DC Comics
Publication Date:  October 1986

Writer:  Paul Levitz
Pencillers:  Greg LaRocque, Colleen Doran, Shawn MacManus, and Gene Colan
Inkers:  Mike DeCarlo and Arne Starr
Colorists:  Carl Gafford
Letterer:  John Costanza
Cover:  Steve Lightle and Anthony Tollin

Princess Projectra returns to her home planet of Orando to speak to the temporary ruling council. She tells them how she has accomplished her goal of returning to Earth and going through a penance to atone for her mistakes in handling Orando. Projectra also proclaims how she does not want to rule Orando anymore and leaves, wanting to be a member of the Legion of Super-Heroes again. Meanwhile, Element Lad takes his girlfriend Shvaughn Erin to his home world of Trom to spend some time together. On Zerox, the Sorcerer's World, White Witch and her fellow sorcerers unleash Mordru from his Earth-covered prison and take his evilness away, magically, and bringing out a good soul. Colossal Boy and his wife Yera visit his parents home and update each other on their lives. The other Legionnaires are enjoying some downtime in their headquarters when they unanimously vote Sensor Girl back into the fold.

